import { useState } from "react";
import {useParams} from 'react-router-dom';
import './AllofCountry.css';

function AllofCountry({data}){
    const {country} =useParams();
    return(
        <div>
            <h1>{country}</h1>
        </div>
    );
}

export default AllofCountry;
